import React from "react";

const ActivityList = ({ activity }) => {
    return (
        <ul id="Class-List">
            {
                activity.map((performed) => (
                    < li key={performed.id}> {item.performed}</li>

                ))}
        </ul>
    )
}

export default ActivityList;
